import './App.css';


function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <main>
          <Navbar/>
          <section className="navbar">
            <Routes>
              <Route path="/" element={<MainInfo/>}/>
            </Routes>
          </section>
        </main>
      </div>
    </BrowserRouter>
  );
}

export default App;
